import React, {Component} from 'react';

export default class Message extends Component {
    state={
        msgArr:[
            {id:'01',title:'消息1111'},
            {id:'02',title:'消息2222'},
            {id:'03',title:'消息3333'}
        ]
    }
    render() {
        const {msgArr}=this.state
        return (
            <div>
                <ul>
                    {
                        msgArr.map((msgObj) => {
                            return  (
                                <li>

                                    <a href="">{msgObj.title}</a>&nbsp;&nbsp;
                                </li>
                            )
                        })
                    }


                </ul>
            </div>
        );
    }
}
